var text = ["","Equilibrium systems are dynamic.","In module 3, we described how reversible reactions eventually reach a <b>steady state</b> where...","...Some reactants are being converted to products and vice versa...","...But the total amounts of reactants and products aren't changing.","But how is it possible that reactions are occurring, but the amounts of products and reactants are staying the same?  This might seem counterintuitive and confusing.","But it actually has a simple explanation:  the concentrations remain constant because, at equilibrium, both the forward and reverse reactions occur at equal <b>rates</b>. The study of rates is called <b>kinetics</b>; this module will explain the relationship between kinetics and equilibrium.","Since the rates are equal at equilibrium, that means the overall concentrations do not change. The amount of product being formed from the forward reaction is exactly balanced by the amount of reactant formed by the reverse reaction.","Recall how we visualized the progress of reaction of the conversion of NO<sub>2</sub> to N<sub>2</sub>O<sub>4</sub> in Module 2.","At the beginning of the reaction, there is no product, so the forward reaction is fast, but as more and more product accumulates, the reaction slows down (we use smaller arrows to indicate that).","As the reverse reaction progresses, the concentration of N<sub>2</sub>O<sub>4</sub> decreases and the rate of the reverse reaction slows.","Since both the forward and reverse reactions occur simultaneously, we can combine them together in the following diagram.","Chemical equilibrium is established when the forward rate is equal to the reverse rate, as occurs at this point. But, why are the rates of the reactions changing?","To answer this we must think about the energy that is involved in making the chemistry happen. We can draw an <b>energy diagram</b> to show this energy. The x axis is the progress of the reaction; the y axis is the free energy. Notice that NO<sub>2</sub> is higher energy than N<sub>2</sub>O<sub>4</sub>. This means that N<sub>2</sub>O<sub>4</sub> is more stable. The products are more stable than the reactants - that means that this reaction is spontaneous - it will happen on its own.","Notice that there is a bump between the reactants and products. This is called the '<b>energy barrier</b>' - the reactants have to undergo some chemistry to create the products and that chemistry takes energy. Some energy barriers are small and some are large. How fast a reaction goes is determined by how much energy it takes to get over the hill, (aka, the energy barrier). Bigger hills take more energy and take longer to climb. So, which reaction is faster, the forward or the reverse?","The forward reaction is faster because it has a smaller hill to climb.","Where does the energy to 'climb the hill' come from? Molecular collisions. In real life, these molecules are constantly bouncing off of one another like bumper cars. To get over the hill, two NO<sub>2</sub> molecules have to hit hard enough (have enough energy) and hit each other in the right place (correct geometry). If you have some NO<sub>2</sub> in a beaker, the molecules are bumping around.  Some are forming N<sub>2</sub>O<sub>4</sub> and some N<sub>2</sub>O<sub>4</sub> is breaking up into NO<sub>2</sub>.  Many are just bumping into each other and nothing is happening.","Since the barrier of the forward reaction is smaller, it takes less energy to cross over. So, a larger percentage of the collisions will have enough energy to cross over - i.e. there will be more <b>productive collisions</b>.","The combination of the number of collisions and the number of molecules that are in the correct geometry is called the rate constant, written as a lower case k. The rate constant is simply how fast the chemistry of that reaction can happen. It is constant for a given temp, pressure, etc. Higher temp means the molecules are moving faster and bumping together more often, so higher temp increases the rate constant.","Mathematically, the rate constant is <b>k</b> = number of collisions * probability of a successful reaction.","The rate constant of the forward reaction is written: k<sub>1</sub> The subscript is 1 because there is only one forward step. Some reactions have multiple steps.","The rate constant of the reverse reaction is written: k<sub>-1</sub>   The subscript is negative to indicate that it is the reverse of k<sub>1</sub>.","Don't confuse rate constants with the rate of reaction, r. The rate of reaction, r, (aka, the rate) is the rate of product formation, or how much product you make in a unit of time (e.g. M/s).","To find the rate of reaction, you multiply how much you have by how fast you can go. Obviously, the more molecules you have, the more collisions there will be, and the faster you can go, so the <b>concentration</b> matters. We write concentrations in brackets like this:  [NO<sub>2</sub>] and [N<sub>2</sub>O<sub>4</sub>].","Now, we can write equations for the rates of the reactions (forward and reverse). If we look at the units, we see that the rate of a reaction will be concentration per unit time, usually M/s.","As a reaction progresses, the rate constants don't change, but the concentrations do, so the rates of reaction will change...for a while at least...until we reach equilibrium. At equilibrium, the forward and reverse rates are the same. We would then write the equation like this.","At equilibrium, the reactions are still occurring, but the concentrations of the reactants and products stays the same. Remember, the reaction quotient, Q, describes the ratio of products to reactants before equilibrium, and the equilibrium constant, K, describes the ratio of products to reactants at equilibrium. So, the equation above can be rearranged so that we see how the ratio of the rates is directly related to the ratio of the concentrations, i.e. the equilibrium constant."];

